export default function Header() {
    return (
        <>
        <p style={{
            margin: 0,
            fontSize: 'calc(var(--page-font-size) * 1.1)'
        }}>Jérémy Lemoine Zemmour</p>
        <p style={{
            margin: 0,
            fontSize: 'calc(var(--page-font-size) * 0.9)',
            marginBottom: '30px'
        }}>Deuxième année de formation d'ingénieur généraliste</p>
        </>
    )
}
